import React, {Component} from 'react';
import {
        DashboardLogo,
        DashboardNavigationWrapper, LogOutButton, LogOutItem, NavigationButton,
        NavigationList,
        NavigationListItem
} from "../styled/Dashboard.styled";
import PressLogo from "../assets/temp_dashboard_logo.png"
import {useNavigate} from "react-router-dom";

function DashboardNavigation(props) {
        const navigate = useNavigate()
        function disconnect(){
                sessionStorage.removeItem("req_token")
                navigate("/")
        }
        return (
            <DashboardNavigationWrapper>
                <DashboardLogo src={PressLogo}/>
                <NavigationList>
                        <NavigationListItem><NavigationButton href={"/dashboard"} active={props.active == "home" ? true : false}> <i className="bi bi-pencil-fill"></i> Gérer les publications</NavigationButton></NavigationListItem>
                        <NavigationListItem><NavigationButton href={"/manage"} active={props.active == "team" ? true : false}> <i className="bi bi-people-fill"></i> Gérer l'équipe</NavigationButton></NavigationListItem>
                        <LogOutItem><LogOutButton onClick={disconnect}> <i className="bi bi-door-open-fill"></i> Se déconnecter</LogOutButton></LogOutItem>
                </NavigationList>
            </DashboardNavigationWrapper>
        );
}

export default DashboardNavigation;
